    const [sub5, setSub5] = React.useState(false);
    const [sub6, setSub6] = React.useState(false);
    const [sub7, setSub7] = React.useState(false);
    
    const [sub, setSub] = React.useState([false,false,false,false,false,false,false]);

    const [state, setState] = React.useState({
        main:true,
        sub1:false,
        sub2:false,
        sub3:false,
        sub4:false,
        sub5:false,
        sub6:false,
        sub7:false,
        sub:[false,false,false,false,false,false,false],
        // 메인 + 서브7=총8개 메뉴
        menu:[true, false,false,false,false,false,false,false]
    });

    // 0-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 0-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const mainSetter=()=>{
        setSub1(false);
        setMain(true);
        setSub2(false);
        setSub3(false);
        setSub4(false);
        setSub5(false);
        setSub6(false);
        setSub7(false);

        // menu[8] => 메뉴별 변경하는 코딩
        // const => 선언과 동시 변경가능
        // const => 선언하고 나중에 변경 불가능
        let menu= state.menu; //상태변수 값을 가져오기 => 클릭하면

    }

    // 1-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 1-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const sub1Setter=()=>{
        setSub1(true);
        setMain(false);
        setSub2(false);
        setSub3(false);
        setSub4(false);
        setSub5(false);
        setSub6(false);
        setSub7(false);
    }

    // 2-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 2-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const sub2Setter=()=>{
        setSub1(false);
        setMain(false);
        setSub2(true);
        setSub3(false);
        setSub4(false);
        setSub5(false);
        setSub6(false);
        setSub7(false);
    }

    // 3-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 3-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const sub3Setter=()=>{
        setSub1(false);
        setMain(false);
        setSub2(false);
        setSub3(true);
        setSub4(false);
        setSub5(false);
        setSub6(false);
        setSub7(false);
    }

    // 4-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 4-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const sub4Setter=()=>{
        setSub1(false);
        setMain(false);
        setSub2(false);
        setSub3(false);
        setSub4(true);
        setSub5(false);
        setSub6(false);
        setSub7(false);
    }

        // 4-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 4-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const sub5Setter=()=>{
        setSub1(false);
        setMain(false);
        setSub2(false);
        setSub3(false);
        setSub4(false);
        setSub5(true);
        setSub6(false);
        setSub7(false);
    }

    // 6-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 6-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const sub6Setter=()=>{
        setSub1(false);
        setMain(false);
        setSub2(false);
        setSub3(false);
        setSub4(false);
        setSub5(false);
        setSub6(true);
        setSub7(false);
    }

    // 7-1. 서브1 신상품 페이지가 보이도록 하는 세터 함수
    // 7-2. sub1Setter() 함수를 헤더컴포넌트에게 프롭스로 내려준다.
    const sub7Setter=()=>{
        setSub1(false);
        setMain(false);
        setSub2(false);
        setSub3(false);
        setSub4(false);
        setSub5(false);
        setSub6(false);
        setSub7(true);
    }
    

    return(
            <div id='wrap'>
                <HeaderComponent 
                mainSetter={mainSetter}
                sub1Setter={sub1Setter}
                sub2Setter={sub2Setter}
                sub3Setter={sub3Setter}
                sub4Setter={sub4Setter}
                sub5Setter={sub5Setter}
                sub6Setter={sub6Setter}
                sub7Setter={sub7Setter}
                />
                    {main && <MainComponent />}
                    {sub1 &&<Sub1Component />}
                    {sub2 &&<Sub2Component />}
                    {sub3 &&<Sub3Component />}
                    {sub4 &&<Sub4Component />}
                    {sub5 &&<Sub5Component />}
                    {sub6 &&<Sub6Component />}
                    {sub7 &&<Sub7Component />}
                {<FooterComponent />}
            </div>
    )
}
